  useEffect(() => {
    toggleSidebar();
    // be joz in ðŸ‘† 2 approach dg ham dare -j86
  }, []);
  return (
    <div>
      <Header />
      <MainPage />
      <Sidebar />

      <Routes>
        <Route path="/" element={<MainPage />} />
        <Route path="/ProductGroupManagement" element={<ProductGroupManagement />} />
      </Routes>
    </div>
  );
};
